      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 BETWEEN + 41 * + ( col2 ) AND + - 18 * + col1 * + - 85 * - - col0 * + col2;
  - name: tab1

outputs:
